import React, { Component } from 'react';
import ReactDOM from 'react-dom';
import { Carousel } from 'react-responsive-carousel';
import './Carousel.css'

export default class HomeCarousel extends Component{
	render(){
		return (
			<Carousel autoplay showArrows={true} showThumbs={false}>
				<div>
					<img  style={{position: "relative", height: 500, right: 0, border: 0,}}
						className="slide" alt="" src="http://lorempixel.com/output/cats-q-c-640-480-1.jpg" />
				</div>
				<div>
					<img className="slide" alt="" src="http://lorempixel.com/output/cats-q-c-640-480-2.jpg" />
				</div>
				<div>
					<img className="slide" alt="" src="http://lorempixel.com/output/cats-q-c-640-480-3.jpg" />
				</div>
			</Carousel>
		);
	}
};
